! Podrá la muerteCubrirme con su fúnebre crespón'),(84,33,6,73,'2023-05-24',2,'mi','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(85,11,1,NULL,'2023-11-25',2,'partido.;Después','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(86,3,13,NULL,'2023-12-08',0,'a','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(87,26,26,75,'2023-12-20',2,'alrededorla','La tierra ensucia las manospero limpia al hombre.'),(88,18,19,25,'2023-12-22',0,'vidanos','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(89,16,6,7,'2023-07-12',1,'palabra','cómo después de acordadoda dolor'),(90,16,5,NULL,'2023-08-02',1,'nadasalvo','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(91,48,4,69,'2023-07-26',2,'mejor.;Pues','Juventud, vasta, lozana, amorosa'),(92,43,27,NULL,'2023-07-26',2,'haya','y llegados, son igualeslos que viven por sus manosy los ricos.'),(93,25,10,25,'2023-10-10',1,'banca','y llegados, son igualeslos que viven por sus manosy los ricos.'),(94,21,19,43,'2023-07-24',1,'mi','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarle