 tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(112,10,23,96,'2023-06-21',3,'semblante,Adriano','Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(113,50,1,96,'2021-08-11',1,'y','y llegados, son igualeslos que viven por sus manosy los ricos.'),(114,21,17,61,'2023-12-13',0,'el','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(115,22,19,86,'2023-07-17',3,'nos','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.'),(116,36,11,7,'2022-12-30',2,'alas','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(117,40,21,68,'2020-08-04',0,'costadoY','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(118,2,27,47,'2022-12-09',0,'en','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(119,10,24,41,'2022-12-19',0,'allá,que','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(120,25,4,72,'2023-11-07',2,'una','Tú que tan grandes tormentossufriste sin resistenciaen tu persona,no por mis merecimientos,mas por tu sola clemencia,me perdona.'),(121,15,11,NULL,'2023-10-21',0,'ningún','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(122,17,12,NULL,'2023-12-29',1,'los','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(123,48,10,23,'2023-06-27',2,'chapada,o','Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(124,4,2,NULL,'2023-07-14',1,'manospero','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(125,40,19,100,'2023-10-10',2,'te','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(126,45,8,30,'2020-06-13',0,'vimos,ni','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(127,39,13,4,'2022-12-09',1,'tres','Por una mirada, un mundo'),(128,38,1,50,'2023-03-09',2,'en',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(129,23,7,112,'2023-06-21',0,'inútil','Por una mirada, un mundo'),(130,4,17,73,'2020-10-08',2,'se','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(131,25,4,4,'2020-12-11',1,'lo','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(132,3,18,80,'2023-10-30',0,'mientras','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(133,7,11,43,'2023-02-26',0,'alrededorla','y llegados, son igualeslos que viven por sus manosy los ricos.'),(134,15,4,44,'2020-11-17',0,'una','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(135,25,11,9,'2023-02-01',4,'con','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(136,27,13,88,'2023-12-21',1,'haya','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(137,38,21,128,'2022-11-05',2,'quizá,','Podrá secarse en un instante el mar'),(138,30,22,132,'2023-10-30',1,'nuestro','por un beso… yo no séqué te diera por un beso.'),(139,46,1,56,'2022-11-21',1,'no','Podrá secarse en un instante el mar'),(140,50,1,40,'2021-08-06',1,'igualeslos','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(141,8,13,100,'2023-10-01',3,'eres','por una sonrisa, un cielo'),(142,20,14,NULL,'2023-12-24',2,'la','así que, cuando morimos,descansamos.'),(143,7,5,39,'2023-10-05',0,'invoco','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(144,11,25,NULL,'2022-04-06',1,'tezde','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(145,4,2,64,'2023-12-13',2,'estas','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(146,41,15,92,'2023-07-26',1,'deidad.;Este','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(147,3,12,114,'2023-10-19',2,'que','Podrá nublarse el sol eternamente'),(148,11,7,50,'2023-12-20',2,'una','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(149,50,15,90,'2023-07-23',1,'de','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(150,33,9,67,'2023-06-30',1,'y','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(151,24,12,100,'2023-02-18',1,'mucho,','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(152,2,4,138,'2023-10-30',2,'la','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(153,33,27,NULL,'2023-10-24',2,'haya','después de tan bien servidala corona de su reyverdadero'),(154,34,21,8,'2023-12-04',0,'ligerezay','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(155,9,1,47,'2023-12-14',3,'a','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(156,16,25,NULL,'2023-10-07',2,'el','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(157,25,10,NULL,'2022-09-11',0,'inútil','no sabrán nunca que nos hemos ido.'),(158,38,1,NULL,'2023-06-10',0,'cerca','dejemos a los romanos,aunque oímos y leímossus historias'),(159,30,11,13,'2023-09-10',1,'brota','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(160,21,21,26,'2023-09-20',3,'madrugada','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(161,11,18,13,'2020-09-28',3,'que','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(162,16,19,NULL,'2022-05-25',4,'firmeza,pues','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(163,29,24,39,'2023-01-15',1,'la','por un beso… yo no séqué te diera por un beso.'),(164,13,20,150,'2020-08-10',0,'flor','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(165,15,5,86,'2022-04-13',1,'dignidadde','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(166,36,6,NULL,'2022-11-19',1,'vida','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(167,32,6,121,'2023-10-21',0,'su','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(168,8,3,42,'2023-09-26',1,'insondable,doy','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(169,31,5,72,'2021-09-15',1,'de','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(170,26,3,NULL,'2023-11-30',5,'solas','Juventud, vasta, lozana, amorosa'),(171,25,6,24,'2023-06-23',1,'huesacon','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(172,14,27,45,'2023-09-26',1,'esclavos,ciegas','En tus ojos nazco, -tus ojos me crean,vivo yo en tus ojos -el sol de mi esfera,en tus ojos muero, -mi casa y vereda,tus ojos mi tumba, -tus ojos mi tierra.'),(173,27,12,145,'2023-04-20',3,'la','por una sonrisa, un cielo'),(174,19,23,83,'2023-10-22',0,'las','no conozco la historia del fuego.'),(175,27,2,34,'2023-10-10',2,'fortalezasy','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(176,7,26,32,'2023-06-26',1,'y','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(177,2,27,174,'2022-09-24',1,'su','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(178,39,2,143,'2022-03-05',0,'mirando','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(179,1,8,55,'2021-03-27',4,'nuestro','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(180,35,10,NULL,'2020-12-23',1,'los','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(181,32,24,36,'2023-12-19',4,'alta','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(182,49,21,NULL,'2023-11-12',1,'será',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(183,19,12,NULL,'2022-12-08',2,'parar;des','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(184,15,12,NULL,'2023-07-05',1,'conoce','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(185,49,6,22,'2021-05-12',0,'perfecta','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(186,13,19,62,'2023-09-21',1,'de','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(187,33,12,132,'2023-04-13',1,'sospechar','Recuerde el alma dormida,avive el seso y despiertecontemplandocómo se pasa la vida,cómo se viene la muertetan callando'),(188,20,8,46,'2022-03-16',3,'ciencia','El amor existecomo un fuegopara abrasar en su bellezatoda la fealdad del mundo.'),(189,34,18,146,'2022-12-09',1,'de','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(190,5,26,87,'2023-12-05',4,'gloria,y','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(191,5,9,NULL,'2023-12-06',2,'un','el olvido es la única venganzay el único perdón.'),(192,3,12,100,'2023-09-05',1,'los','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(193,25,9,NULL,'2023-10-28',2,'el','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(194,45,19,64,'2023-02-04',0,'y','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(195,42,2,114,'2022-01-23',2,'maltratabantodos','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(196,6,5,145,'2023-12-13',0,'sitio','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(197,30,19,136,'2023-12-21',0,'parecercualquiera','después de tan bien servidala corona de su reyverdadero'),(198,15,15,NULL,'2021-09-23',0,'propio','Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(199,3,25,105,'2023-12-26',1,'como','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(200,29,23,94,'2023-07-24',2,'por','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(201,6,11,81,'2023-12-16',3,'la','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(202,22,26,127,'2022-10-05',1,'ti,pero','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(203,45,9,67,'2023-11-27',3,'fin','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(204,33,8,47,'2023-04-28',1,'fuerza','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(205,38,22,56,'2023-11-18',3,'amó,un','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(206,35,24,NULL,'2022-09-07',2,'certidumbre','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(207,40,2,11,'2020-04-10',1,'no','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(208,28,4,118,'2022-12-09',2,'verde,','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(209,8,23,198,'2021-09-23',1,'grandes','El Agua se conoce por la sed'),(210,17,7,NULL,'2023-08-13',1,'sencillo','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(211,31,7,NULL,'2021-08-30',1,'de','allí los ríos caudales,allí los otros medianosy más chicos'),(212,19,15,NULL,'2023-11-17',0,'hora,y','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(213,10,6,24,'2022-11-18',0,'hicieron?¿Qué','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(214,15,23,28,'2023-02-27',2,'labios,un','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(215,47,23,100,'2023-05-22',0,'secretassus','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(216,10,4,188,'2022-03-16',2,'es','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(217,1,12,NULL,'2023-07-20',1,'sabery','Juventud, vasta, lozana, amorosa'),(218,47,26,14,'2023-05-23',2,'vio,pues','Pero creo que mi soledad debería tener alas.'),(219,8,19,165,'2022-04-13',3,'la','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(220,10,25,NULL,'2021-05-21',3,'hombre','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(221,24,20,57,'2021-11-26',3,'fuerza','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(222,21,9,NULL,'2021-07-28',4,'la','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(223,18,6,NULL,'2023-10-06',2,'fino!,','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(224,33,18,76,'2021-01-14',1,'entre','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(225,16,2,120,'2023-11-07',0,'de','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(226,19,2,215,'2022-12-18',1,'tierra?Mi','Juventud, vasta, lozana, amorosa'),(227,6,10,107,'2023-12-22',1,'gracia,fuerza','cómo después de acordadoda dolor'),(228,12,25,139,'2021-04-23',0,'tú?','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(229,30,24,33,'2023-01-05',1,'hazlo.Hazlo.Hasta','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(230,25,17,62,'2023-07-26',1,'un','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(231,4,1,167,'2023-09-11',0,'soledad…La','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(232,33,22,184,'2023-07-05',1,'sumo','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(233,12,13,NULL,'2021-09-16',3,'silencio','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(234,48,11,NULL,'2022-09-24',2,'lo','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(235,46,25,NULL,'2020-09-10',1,'espléndido,','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(236,35,2,NULL,'2023-11-19',1,'muera,es','después de tan bien servidala corona de su reyverdadero'),(237,41,5,NULL,'2021-07-24',1,'aun','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(238,22,3,63,'2023-05-26',1,'se','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(239,15,12,53,'2023-12-12',1,'es','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(240,21,10,NULL,'2020-12-02',1,'entre','Pero creo que mi soledad debería tener alas.'),(241,20,17,212,'2023-11-17',2,'nuestros','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(242,22,27,NULL,'2023-06-10',2,'séqué','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(243,45,24,191,'2023-12-06',2,'le','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(244,23,1,65,'2022-07-03',1,'vezcuando','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(245,25,9,90,'2022-09-08',1,'tu','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(246,32,8,88,'2023-12-15',0,'le','Cuando pasen los años, cuando pasenlos años y el aire haya cavado un fosoentre tu alma y la mía'),(247,20,9,NULL,'2023-10-09',3,'con','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(248,16,3,125,'2021-06-16',1,'justo','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(249,4,20,NULL,'2023-08-24',0,'sus','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(250,10,6,238,'2023-03-13',2,'qué',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(251,12,14,163,'2022-09-21',1,'el','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(252,34,16,125,'2023-10-10',2,'frente','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(253,29,11,171,'2023-06-23',1,'que','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(254,43,5,54,'2023-03-02',1,'su','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(255,43,18,83,'2022-07-19',0,'tí.;Amar,','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(256,30,18,102,'2023-08-16',2,'obrófue','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(257,34,17,146,'2023-07-26',1,'es','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(258,42,26,218,'2022-07-20',2,'puedes','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(259,31,9,137,'2022-11-05',1,'la','Cuando pasen los años, cuando pasenlos años y el aire haya cavado un fosoentre tu alma y la mía'),(260,42,23,66,'2021-07-23',3,'bruja','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(261,18,5,187,'2020-01-07',1,'tierrasocupadas','Somos obras de arte momentáneamente vivientes.'),(262,41,2,NULL,'2023-05-13',0,'cobró.Pues','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(263,33,21,249,'2023-08-24',0,'herida','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(264,33,26,201,'2023-08-02',1,'otras','Yo no hablo de venganzas ni de perdones'),(265,15,13,238,'2023-05-26',2,'nombre,conjuré','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(266,6,20,NULL,'2023-06-05',3,'corta','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(267,32,9,NULL,'2023-10-22',1,'el','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(268,35,9,62,'2023-07-29',3,'precario,demasiado','Esta noche al oído me has dicho dos palabrasComunes. Dos palabras cansadasDe ser dichas. Palabras que de viejas son nuevas.Dos palabras tan dulces, que la luna que andabaFiltrando entre las ramasSe detuvo en mi boca. Tan dulces dos palabrasQue una hormiga pasea por mi cuello y no intentoMoverme para echarla.Tan dulces dos palabrasQuq digo sin quererlo- ¡oh, qué bella, la vida!-Tan dulces y tan mansasQue aceites olorosos sobre el cuerpo derraman.Tan dulces y tan bellasQue los dedos más largos de mi mano derechaSe mueven hacia el cielo imitando tijeras.Oh, mis dedos quisieranCortar estrellas.'),(269,1,3,NULL,'2022-11-23',4,'rubia,y','Somos obras de arte momentáneamente vivientes.'),(270,1,6,NULL,'2023-12-19',0,'hizo','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(271,50,11,158,'2023-06-10',2,'leímossus','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(272,1,11,223,'2022-07-14',0,'nuestro','Nuestras vidas son los ríosque van a dar en la mar,que es el morir:allí van los señoríos,derechos a se acabary consumir'),(273,27,17,156,'2021-09-19',0,'pos','Por una mirada, un mundo'),(274,46,7,142,'2023-12-24',0,'buscallos?¿qué','Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(275,2,13,5,'2020-11-11',0,'siendo','no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(276,46,4,148,'2023-09-02',2,'lo','después de tan bien servidala corona de su reyverdadero'),(277,35,17,271,'2023-05-18',5,'que','no sabrán nunca que nos hemos ido.'),(278,33,10,173,'2020-03-29',2,'donde','no conozco la historia del fuego.'),(279,28,4,125,'2022-05-23',0,'eres','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(280,33,8,256,'2023-08-06',0,'andamosy','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(281,1,21,NULL,'2023-04-28',0,'caballosde','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(282,36,2,168,'2023-05-14',0,'infelicidad','Ved de cuán poco valorson las cosas tras que andamosy corremos,que en este mundo traidoraun primero que muramoslas perdemos.De ellas deshace la edad,de ellas casos desastradosque acaecen,de ellas, por su calidad,en los más altos estadosdesfallecen.'),(283,6,16,280,'2023-08-06',0,'revuelven','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(284,6,6,15,'2023-03-21',1,'su','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(285,45,26,86,'2022-06-20',0,'mandar,¿qué','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(286,49,26,NULL,'2022-08-18',1,'a','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(287,15,24,79,'2022-09-06',0,'nos','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(288,28,15,97,'2020-11-17',2,'gran','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(289,45,25,268,'2021-05-29',4,'otros','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(290,3,15,226,'2022-07-24',1,'o','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(291,10,19,182,'2023-11-12',3,'es','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(292,11,1,268,'2022-09-10',1,'ojos','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(293,19,22,NULL,'2022-05-21',0,'inútil','cómo después de acordadoda dolor'),(294,23,19,193,'2021-05-07',1,'buen','cómo después de acordadoda dolor'),(295,9,8,NULL,'2022-06-11',3,'tormentos','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(296,33,25,62,'2023-12-29',0,'dicho.Después','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(297,1,7,282,'2021-06-08',3,'ceño,','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.'),(298,36,2,91,'2023-07-26',0,'quererlo-','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(299,10,4,205,'2022-02-18',1,'mañana.;El','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(300,1,12,252,'2023-07-07',0,'corona','allí los ríos caudales,allí los otros medianosy más chicos'),(301,28,4,225,'2023-04-01',1,'finY','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(302,40,25,156,'2023-10-07',0,'es','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(303,4,5,77,'2023-07-19',4,'cubre,negra','Somos obras de arte momentáneamente vivientes.'),(304,49,6,139,'2022-11-21',1,'ríos','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(305,43,20,302,'2023-10-07',2,'si','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(306,47,10,109,'2021-02-13',2,'un','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(307,42,24,298,'2023-07-26',2,'los','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(308,6,27,134,'2020-11-17',1,'siendo','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(309,8,13,NULL,'2023-01-27',2,'engañen,pues','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(310,24,3,30,'2023-09-02',2,'se','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(311,31,17,214,'2023-02-27',1,'afirmaciones,de','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(312,45,5,116,'2022-07-06',6,'gestos,','Pero creo que mi soledad debería tener alas.'),(313,20,15,41,'2023-05-13',2,'una','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(314,3,25,246,'2023-12-15',0,'de','no sabrán nunca que nos hemos ido.'),(315,4,8,NULL,'2023-04-05',0,'es','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(316,9,7,102,'2023-04-26',0,'crespón;Pero','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(317,23,7,177,'2022-07-06',0,'ode','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(318,35,9,18,'2023-02-20',4,'o','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(319,37,13,305,'2022-02-09',3,'el','por una sonrisa, un cielo'),(320,36,21,212,'2023-08-01',4,'(porque','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(321,23,10,243,'2023-01-03',2,'tú.¿Y','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(322,23,23,NULL,'2023-10-26',3,'alondra;La','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(323,10,23,149,'2023-07-23',3,'a','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(324,9,20,280,'2023-05-14',1,'ve','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(325,28,13,190,'2023-12-05',3,'vida','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(326,2,16,NULL,'2023-11-30',2,'segundos','Yo no hablo de venganzas ni de perdones'),(327,16,16,40,'2021-05-01',1,'excelentes,tantos','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(328,18,15,300,'2022-01-22',0,'por','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(329,28,19,NULL,'2022-07-22',3,'fuego.;Pero','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(330,11,19,253,'2022-09-06',2,'rasgada','Yo no hablo de venganzas ni de perdones'),(331,18,27,NULL,'2023-06-25',1,'más','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(332,2,27,39,'2023-02-17',0,'tú','El Agua se conoce por la sed'),(333,43,5,319,'2020-04-10',0,'corredores,y','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(334,20,8,127,'2022-12-09',2,'me','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(335,24,12,242,'2022-08-11',0,'lágrima','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(336,6,18,3,'2022-09-12',0,'llevados','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(337,29,1,NULL,'2023-05-22',0,'ensucia','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(338,25,18,98,'2023-09-02',2,'toro','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(339,33,14,135,'2022-10-25',4,'de','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(340,46,8,NULL,'2022-11-14',1,'largade','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(341,47,6,183,'2022-12-08',1,'vivircuando','Tú que tan grandes tormentossufriste sin resistenciaen tu persona,no por mis merecimientos,mas por tu sola clemencia,me perdona.'),(342,30,17,141,'2023-10-01',1,'ese','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(343,19,1,39,'2021-09-11',1,'bien','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(344,43,2,310,'2022-12-25',2,'compañía...Y','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(345,8,19,12,'2023-12-01',2,'y','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(346,10,25,186,'2023-09-21',1,'cosas','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(347,37,11,NULL,'2022-12-24',2,'infinitos','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(348,10,14,93,'2021-04-16',0,'llorar','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(349,21,22,NULL,'2023-07-25',3,'la','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(350,1,11,NULL,'2022-09-06',2,'más','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(351,15,23,NULL,'2023-04-25',3,'de','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(352,45,8,NULL,'2023-06-02',0,'volar.Aférrate','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(353,40,15,NULL,'2023-03-30',3,'extrañamente','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(354,47,17,69,'2023-11-28',0,'con','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(355,39,17,NULL,'2020-05-23',1,'curso','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(356,20,21,30,'2023-10-21',1,'marchanla','Hay besos que producen desvaríosde amorosa pasión ardiente y loca,tú los conoces bien son besos míosinventados por mí, para tu boca.'),(357,14,1,NULL,'2021-09-18',0,'y','Ponerlo todo en duda es el único modo de ordenarme'),(358,28,4,NULL,'2023-04-15',3,'no','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(359,19,10,NULL,'2023-12-08',3,'me','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(360,18,13,NULL,'2023-09-22',0,'pulcrotan','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(361,4,7,NULL,'2022-08-28',0,'le','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(362,39,2,342,'2023-10-01',3,'Saboreacada','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(363,34,7,133,'2023-02-26',1,'el','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(364,28,12,66,'2023-12-27',1,'nuevo','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(365,33,11,270,'2023-12-19',2,'capitán','El Agua se conoce por la sed'),(366,21,19,199,'2021-05-05',2