icos.'),(491,20,19,293,'2022-05-21',2,'de','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(492,38,3,472,'2022-01-22',1,'amó,un','así que, cuando morimos,descansamos.'),(493,40,24,26,'2020-04-10',1,'la','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(494,27,11,356,'2023-10-21',1,'precario.;Esta','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(495,8,27,253,'2022-02-14',1,'derramasteisde','Podrá secarse en un instante el mar'),(496,5,10,370,'2023-07-05',0,'sécon','cómo después de acordadoda dolor'),(497,16,6,NULL,'2023-09-12',1,'su','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(498,7,18,NULL,'2022-12-08',3,'un','Se extingue el díapero no el canto de la alondra'),(499,37,16,NULL,'2020-09-15',0,'corazón','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(500,40,26,323,'2023-07-23',0,'placentera,clara','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(501,40,18,7,'2022-12-30',3,'de','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(502,19,1,NULL,'2023-12-29',2,'ya','el olvido es la única venganzay el único perdón.'),(503,48,1,200,'2021-07-28',1,'queramos','por una sonrisa, un cielo'),(504,17,4,397,'2023-09-25',1,'sabe','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(505,27,25,154,'2023-08-03',2,'a','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(506,48,3,196,'2022-10-03',1,'y','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(507,14,1,NULL,'2023-08-16',2,'de','Podrá secarse en un instante el mar'),(508,5,12,NULL,'2023-12-06',2,'ellas','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(509,24,15,153,'2023-10-24',5,'una,ni','La tierra ensucia las manospero limpia al hombre.'),(510,50,22,353,'2023-03-30',1,'el','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(511,8,3,NULL,'2022-06-30',0,'por','Este mundo es el caminopara el otro, que es moradasin pesar'),(512,6,5,127,'2020-02-24',3,'y','Yo no hablo de venganzas ni de perdones'),(513,9,26,205,'2022-11-21',2,'lo','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(514,37,13,265,'2023-05-26',3,'nos','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(515,29,4,409,'2022-05-07',1,'rumbo','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(516,23,13,303,'2021-12-19',1,'sin','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(517,49,12,43,'2023-09-10',1,'arriesgarlas','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(518,36,16,316,'2023-04-26',1,'dioses','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(519,36,3,293,'2021-11-28',1,'que','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(520,14,23,469,'2023-05-09',0,'mi','Yo no hablo de venganzas ni de perdones'),(521,13,25,490,'2022-11-20',1,'triste,','Por una mirada, un mundo'),(522,17,10,265,'2022-12-30',1,'eres,','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(523,9,20,285,'2022-03-21',3,'-inicial','Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(524,39,9,NULL,'2023-10-01',1,'a','así que, cuando morimos,descansamos.'),(525,37,3,405,'2023-01-29',1,'muerte','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(526,15,20,340,'2022-11-14',3,'Solo','Podrá secarse en un instante el mar'),(527,27,16,448,'2023-09-02',2,'de','vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(528,24,11,515,'2021-03-24',0,'halló,mas','vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(529,31,21,NULL,'2023-01-28',4,'una','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(530,22,17,95,'2022-07-23',1,'la','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(531,24,18,281,'2022-05-16',0,'boca','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(532,35,2,477,'2022-11-08',1,'hermano,','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(533,11,8,NULL,'2023-11-20',4,'siglo',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(534,34,8,NULL,'2023-04-21',1,'bellasQue','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(535,11,11,NULL,'2023-09-21',2,'la','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(536,2,21,276,'2023-09-02',1,'rumbo','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(537,25,20,289,'2021-05-29',2,'mientras','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(538,8,19,483,'2022-11-26',4,'de','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(539,37,18,NULL,'2020-07-10',2,'pecadosinfernales,mas','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(540,41,11,402,'2023-01-25',4,'amante','por una sonrisa, un cielo'),(541,32,24,337,'2022-11-20',1,'allá,que','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(542,47,7,45,'2023-05-06',3,'enriques','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(543,18,5,312,'2022-02-07',0,'como','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(544,36,5,253,'2020-09-23',0,'de','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(545,6,25,NULL,'2023-01-08',0,'toda','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(546,40,8,77,'2022-07-02',2,'hacerel','Somos obras de arte momentáneamente vivientes.'),(547,4,12,508,'2023-12-06',4,'frescode','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(548,29,21,NULL,'2021-04-06',2,'ligerezay','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(549,43,25,427,'2023-05-14',0,'lo','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(550,44,12,228,'2021-04-23',3,'copas,','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(551,13,13,NULL,'2023-07-02',1,'del','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(552,42,18,81,'2022-10-04',1,'manos','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(553,21,3,29,'2020-08-02',1,'regalo.Los','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(554,47,24,341,'2022-12-08',1,'alas','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(555,7,2,NULL,'2022-03-05',1,'retener','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(556,46,14,NULL,'2022-08-01',0,'no','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(557,25,15,536,'2020-08-15',2,'hermanos','Se extingue el díapero no el canto de la alondra'),(558,35,27,47,'2023-11-03',2,'a','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(559,18,21,NULL,'2023-09-12',0,'eshablartey','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(560,3,3,385,'2021-09-16',1,'la','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(561,42,27,173,'2023-04-20',1,'cuenta','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(562,34,10,241,'2022-11-03',1,'que','Ponerlo todo en duda es el único modo de ordenarme'),(563,10,21,140,'2021-08-06',0,'pirata','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(564,4,11,202,'2020-03-22',2,'del','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta,