23-09-20',1,'deleitamos,temporales,y','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(804,35,23,592,'2020-09-04',1,'discurrir','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(805,36,22,370,'2023-04-06',0,'hombre;Tú','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(806,45,26,740,'2023-09-03',5,'oh','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(807,20,9,145,'2022-11-16',1,'tu','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(808,26,17,NULL,'2020-10-10',0,'cabezadesde','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(809,9,18,739,'2022-10-26',1,'no','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(810,5,22,70,'