ue el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1002,42,26,354,'2021-11-08',2,'un','Se extingue el díapero no el canto de la alondra'),(1003,43,19,NULL,'2022-08-09',1,'mancha','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(1004,50,10,691,'2021-08-16',1,'ve','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1005,32,18,636,'2021-09-16',3,'dicho,tergiversada','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1006,15,20,NULL,'2023-07-13',1,'él','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1007,13,21,488,'2020-12-26',0,'adivina','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1008,30,1,746,'2021-08-02',2,'a','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1009,39,24,NULL,'2022-11-15',0,'ríos',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1010,33,21,239,'2022-09-15',2,'cuando','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1011,40,10,985,'2022-08-24',0,'los','Juventud, vasta, lozana, amorosa'),(1012,16,1,818,'2022-08-25',1,'muerte,','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1013,13,16,NULL,'2021-06-18',1,'¡pierden','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1014,2,18,432,'2022-08-10',1,'abuelo','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1015,18,9,NULL,'2023-06-26',1,'quererlo-','Ved de cuán poco valorson las cosas tras que andamosy corremos,que en este mundo traidoraun primero que muramoslas perdemos.De ellas deshace la edad,de ellas casos desastradosque acaecen,de ellas, por su calidad,en los más altos estadosdesfallecen.'),(1016,21,13,921,'2023-11-03',0,'los','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1017,21,8,123,'2022-06-02',0,'de','Se extingue el díapero no el canto de la alondra'),(1018,19,11,739,'2023-06-03',0,'insondable,doy','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1019,33,21,543,'2021-02-13',0,'sujetos!,y','dejemos a los romanos,aunque oímos y leímossus historias'),(1020,36,15,618,'2022-12-30',3,'quedaen','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1021,50,7,604,'2020-07-18',0,'dignidadde','Ten Esperanz