ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1064,4,15,420,'2021-01-10',2,'engañosoy','Dejo las invocacionesde los famosos poetasy oradores'),(1065,20,8,NULL,'2022-01-06',2,'burlas,','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1066,12,19,760,'2023-12-03',1,'criadosy','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1067,16,22,316,'2022-06-04',4,'tesoros,sus','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1068,5,4,489,'2021-05-27',2,'juzgamos','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1069,7,2,NULL,'2022-07-29',1,'conocimos,tan','así que, cuando morimos,descansamos.'),(1070,18,24,NULL,'2022-09-19',3,'serY','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1071,28,11,NULL,'2020-04-14',0,'la','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1072,38,17,489,'2023-02-07',1,'puerta,deshojando','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1073,16,13,896,'2021-02-21',1,'caemos:No','Después de puesta la vidatantas veces por su leyal tablero'),(1074,9,24,311,'2023-02-27',3,'varón,tanta','allí los ríos caudales,allí los otros medianosy más chicos'),(1075,5,20,1001,'2022-07-10',1,'por','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1076,3,12,679,'2020-03-26',2,'siempre,','dejemos a los romanos,aunque oímos y leímossus historias'),(1077,33,23,385,'2022-03-05',0,'cara,la',' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(1078,4,23,998,'2023-01-03',2,'timideznos','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1079,46,13,1061,'2022-04-25',2,'en','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(1080,9,23,769,'2020-07-29',1,'las','Yo no hablo de venganzas ni de perdones'),(1081,41,10,152,'2023-10-14',1,'mí','El Agua se conoce por la sed'),(1082,39,21,8,'2023-08-15',3,'minuto','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1083,29,16,NULL,'2023-03-06',0,'y','Yo no sé de pájaros,'),(1084,19,21,NULL,'2022-12-26',1,'podemos','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1085,21,23,347,'2022-12-24',1,'el','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1086,36,12,26,'2021-11-04',3,'la','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1087,16,5,NULL,'2023-10-09',2,'fin','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1088,24,5,193,'2020-12-09',2,'fue','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1089,36,4,NULL,'2022-02-23',2,'de','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1090,17,11,NULL,'2020-12-09',0,'la','no sabrán nunca que nos hemos ido.'),(1091,18,13,774,'2020-12-15',3,'con','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(1092,41,3,NULL,'2021-11-01',0,'instante','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1093,9,8,912,'2023-01-10',3,'le','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1094,25,21,1003,'2020-11-04',2,'tu','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1095,5,8,213,'2022-11-18',0,'los','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1096,48,13,281,'2020-11-04',0,'mi','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1097,11,6,NULL,'2023-01-20',1,'el','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1098,24,20,NULL,'2023-04-29',2,'caemos:No','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1099,49,19,NULL,'2023-06-09',2,'es','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1100,17,15,1003,'2021-11-04',3,'a','Podrá secarse en un instante el mar'),(1101,31,1,NULL,'2023-07-19',0,'estadoen','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1102,40,13,NULL,'2023-11-09',1,'ríos','Somos obras de arte momentáneamente vivientes.'),(1103,19,17,321,'2023-01-03',1,'hecho','Este mundo es el caminopara el otro, que es moradasin pesar'),(1104,28,6,NULL,'2022-10-19',3,'perdiendo.El','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1105,2,16,1006,'2020-05-26',1,'unidad','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1106,20,11,344,'2022-12-25',3,'que','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1107,33,22,NULL,'2023-11-02',3,'peores','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1108,33,3,635,'2023-08-18',4,'tu','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1109,37,26,40,'2021-08-06',1,'maestre',' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(1110,32,6,NULL,'2021-06-12',1,'pero','Ponerlo todo en duda es el único modo de ordenarme'),(1111,45,21,NULL,'2022-07-12',2,'vajillas,mas','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1112,13,20,NULL,'2021-07-28',2,'superior','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(1113,33,16,943,'2021-03-23',5,'y','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1114,5,16,815,'2021-06-30',1,'dádivas','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1115,20,8,440,'2022-01-27',3,'el','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1116,36,7,NULL,'2022-03-17',0,'luna','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1117,1,10,527,'2021-07-09',2,'tu','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1118,49,19,NULL,'2022-01-02',2,'perfecta','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1119,18,17,422,'2020-01-04',3,'hay','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(1120,2,6,157,'2022-09-11',1,'mueven','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1121,16,18,375,'2023-12-25',2,'consumir;allí','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1122,37,17,NULL,'2023-05-27',4,'que','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1123,14,17,442,'2023-06-27',0,'vio,pues','no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(1124,6,6,643,'2021-07-15',3,'benigno','Después de puesta la vidatantas veces por su leyal tablero'),(1125,7,17,NULL,'2021-05-19',2,'el','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1126,41,20,252,'2023-10-10',2,'no','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1127,44,19,541,'2022-06-21',0,'sin','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1128,16,2,1025,'2020-05-17',3,'mundo','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1129,37,8,945,'2023-10-30',5,'para','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1130,24,26,NULL,'2021-09-25',2,'somosy','así que, cuando morimos,descansamos.'),(1131,4,13,NULL,'2023-11-04',2,'seasme','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1132,23,7,192,'2023-09-05',2,'de','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1133,25,15,NULL,'2023-04-19',2,'prometía.;Antonio','Yo no sé de pájaros,'),(1134,6,14,447,'2020-05-16',1,'mi','Nuestras vidas son los ríosque van a dar en la mar,que es el morir:allí van los señoríos,derechos a se acabary consumir'),(1135,33,7,194,'2023-02-04',4,'tu','La tierra ensucia las manospero limpia al hombre.'),(1136,37,15,NULL,'2023-04-15',3,'quien','Yo no sé de pájaros,'),(1137,22,22,410,'2023-08-29',2,'tú,',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1138,43,23,544,'2020-09-23',3,'sola','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1139,48,1,522,'2022-12-30',2,'boca.;La','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1140,6,11,1105,'2020-05-26',2,'-y','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1141,50,25,212,'2023-06-25',1,'gran','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1142,25,10,8,'2022-06-03',2,'privado,no','así que, cuando morimos,descansamos.'),(1143,17,16,987,'2023-11-20',1,'conmigo(lo','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1144,17,14,NULL,'2021-01-03',2,'cierta,en','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1145,23,9,354,'2023-05-20',1,'alta','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1146,30,18,587,'2023-05-23',1,'tanta','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1147,47,2,563,'2021-08-06',2,'pero','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1148,34,25,430,'2022-06-08',3,'hicieron','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1149,13,17,270,'2020-04-15',2,'del','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1150,16,10,NULL,'2022-05-25',0,'tu','Podrá nublarse el sol eternamente'),(1151,41,10,868,'2023-07-20',1,'exacto:Una','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(1152,39,10,92,'2022-09-15',1,'vuelve.Miras','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1153,10,4,939,'2020-04-24',2,'cuello','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1154,5,2,1148,'2020-04-16',2,'doy','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1155,37,3,NULL,'2021-11-21',1,'juventud','Se extingue el díapero no el canto de la alondra'),(1156,4,17,808,'2020-10-10',1,'palabras','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1157,21,14,1132,'2023-09-05',2,'se','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(1158,15,24,NULL,'2022-11-21',1,'es','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(1159,17,20,239,'2023-12-12',1,'higo;un','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1160,23,3,NULL,'2021-03-06',2,'fuerza','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1161,33,8,9,'2021-07-23',0,'yode','Yo no sé de pájaros,'),(1162,48,21,213,'2021-09-02',3,'hazlo.Hazlo.Hasta','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1163,25,14,NULL,'2021-06-17',2,'soledadde','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1164,4,9,638,'2021-07-12',2,'táctica','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1165,49,18,339,'2022-10-25',3,'que','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1166,21,1,268,'2023-07-29',1,'de','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1167,8,26,28,'2021-02-05',1,'que','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1168,40,21,552,'2020-10-03',1,'nadie,','Se extingue el díapero no el canto de la alondra'),(1169,38,10,NULL,'2023-08-17',2,'como','no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(1170,24,11,277,'2020-06-09',1,'corderos.Y','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1171,39,25,NULL,'2023-08-22',1,'cabezadesde','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1172,39,10,15,'2022-12-14',0,'que','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1173,48,13,888,'2021-11-04',1,'ti.Si','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1174,45,13,713,'2022-10-21',0,'el','Podrá secarse en un instante el mar'),(1175,38,26,433,'2021-02-24',1,'la','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1176,8,1,NULL,'2023-07-09',1,'eso','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1177,4,24,NULL,'2021-06-05',2,'rigorde','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1178,15,26,522,'2022-06-10',1,'extingue','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1179,30,20,94,'2020-03-25',2,'más','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1180,25,14,919,'2020-06-28',0,'el','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1181,26,23,NULL,'2022-07-28',1,'cielo;por','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1182,30,25,550,'2021-04-23',3,'sueños','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1183,46,18,NULL,'2023-01-02',0,'en','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1184,41,25,858,'2021-11-03',4,'sus','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1185,45,20,NULL,'2023-12-06',1,'y','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1186,18,20,362,'2023-10-01',1,'Noche','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1187,44,17,751,'2020-10-14',0,'yo','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1188,1,25,1157,'2021-12-06',1,'las','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1189,10,13,558,'2020-03-25',1,'naveses','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1190,27,8,754,'2022-07-27',1,'Esperanza.','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1191,33,7,750,'2021-05-01',1,'que','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1192,44,5,676,'2022-09-18',0,'moros','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1193,11,24,1102,'2023-11-09',3,'ve','Podrá nublarse el sol eternamente'),(1194,11,6,1103,'2021-11-07',0,'que,','después de tan bien servidala corona de su reyverdadero'),(1195,10,21,NULL,'2022-09-24',2,'-','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1196,5,11,NULL,'2022-04-17',1,'cosa','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1197,40,18,NULL,'2020-09-06',4,'ojos','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1198,44,24,917,'2021-06-11',0,'una','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1199,25,25,195,'2021-12-15',0,'hombre','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1200,29,21,948,'2020-04-01',1,'de','Podrá secarse en un instante el mar'),(1201,48,3,409,'2023-04-20',0,'tierra','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1202,38,4,NULL,'2021-07-15',1,'cómo','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1203,40,11,387,'2021-07-23',4,'estadosmundanales,ni','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(1204,44,16,NULL,'2022-03-12',0,'es','así que, cuando morimos,descansamos.'),(1205,16,24,579,'2021-11-10',1,'fama','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1206,23,14,850,'2022-06-22',1,'el','La tierra ensucia las manospero limpia al hombre.'),(1207,11,21,416,'2023-10-03',2,'del','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1208,31,16,50,'2023-03-29',3,'voluntad','Por una mirada, un mundo'),(1209,45,14,77,'2023-11-15',2,'sosmi','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1210,28,14,523,'2022-03-21',1,'se','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1211,31,25,191,'2023-07-05',3,'estable','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1212,31,18,NULL,'2023-02-22',3,'amor','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1213,13,27,NULL,'2023-06-05',4,'la','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1214,42,20,985,'2020-05-11',0,'sobre','un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(1215,46,19,401,'2022-07-20',0,'olvidada,el','dejemos a los romanos,aunque oímos y leímossus historias'),(1216,12,16,88,'2023-02-26',1,'sonrisa,','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1217,2,24,447,'2021-12-05',1,'la','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1218,34,17,39,'2020-02-11',0,'eso',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1219,3,23,NULL,'2022-01-14',2,'corazón','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1220,13,19,471,'2022-01-23',1,'divinal!Cuando','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(1221,3,5,954,'2023-07-25',2,'que','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1222,49,4,148,'2020-09-02',1,'la','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1223,22,7,421,'2020-04-01',3,'de','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(1224,50,24,602,'2022-09-21',3,'dura','Por una mirada, un mundo'),(1225,1,7,1210,'2022-03-21',1,'acompañeny','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1226,46,26,972,'2023-08-23',3,'clavos,nos','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1227,23,25,NULL,'2020-07-23',3,'privado,no','Este mundo es el caminopara el otro, que es moradasin pesar'),(1228,21,3,NULL,'2022-04-24',1,'de','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1229,2,13,226,'2022-12-18',2,'que','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1230,47,24,290,'2022-07-24',1,'mancha','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1231,26,19,NULL,'2021-06-12',1,'se','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1232,17,2,1006,'2023-07-13',0,'total','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(1233,36,6,NULL,'2020-10-28',0,'caudales,allí','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1234,42,25,829,'2021-12-23',0,'amargala','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(1235,34,1,NULL,'2020-06-27',2,'sí!','cuán presto se va el placer'),(1236,36,22,520,'2023-05-09',0,'más','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1237,12,10,956,'2023-11-24',2,'eje','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1238,11,2,650,'2020-06-01',2,'nuestros','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(1239,40,10,837,'2021-04-22',0,'me','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1240,2,3,NULL,'2022-04-21',2,'parque.Esto','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1241,40,6,NULL,'2020-05-25',0,'sutil','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1242,17,16,NULL,'2023-07-14',1,'tras','Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(1243,1,25,1207,'2020-11-04',2,'tiempo','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1244,18,12,927,'2021-01-01',2,'intentarlo,','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(1245,11,27,975,'2020-03-08',1,'otras','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(1246,13,3,154,'2021-11-02',1,'ser','dejemos a los romanos,aunque oímos y leímossus historias'),(1247,20,15,676,'2020-09-03',2,'cicatriz','¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1248,29,25,103,'2020-09-05',1,'misma','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1249,13,22,NULL,'2023-01-03',2,'otro','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1250,12,18,NULL,'2022-08-18',1,'en','así que, cuando morimos,descansamos.'),(1251,16,7,869,'2023-03-07',0,'conociósu','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1252,26,19,170,'2021-12-07',0,'pues,El','así que, cuando morimos,descansamos.'),(1253,44,11,796,'2023-11-18',2,'para','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1254,46,25,129,'2023-06-21',0,'lainfelicidad.;Llevo','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1255,49,2,NULL,'2020-11-01',2,'la','Pero creo que mi soledad debería tener alas.'),(1256,3,9,NULL,'2021-08-14',0,'no','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1257,25,25,NULL,'2022-09-16',4,'los','por una sonrisa, un cielo'),(1258,49,9,NULL,'2021-12-07',3,'que','Juventud, vasta, lozana, amorosa'),(1259,32,12,1183,'2023-01-02',1,'profunda','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1260,48,9,942,'2022-03-06',2,'desde','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(1261,43,14,NULL,'2021-11-13',1,'hazlo,','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1262,18,27,327,'2021-05-01',3,'sabemos','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1263,2,19,1063,'2020-01-17',2,'higo;un','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1264,10,24,461,'2022-01-15',2,'mi','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1265,41,22,243,'2022-12-26',4,'he','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1266,24,23,82,'2022-04-27',2,'la','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(1267,47,17,706,'2023-09-02',0,'dices','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1268,4,14,NULL,'2020-12-12',3,'noblezatan','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(1269,23,7,298,'2020-03-28',3,'la','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1270,17,15,485,'2020-04-27',1,'aprovecha?cuando','Por una mirada, un mundo'),(1271,27,11,122,'2023-12-29',2,'tu','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1272,42,1,725,'2020-11-26',3,'no','Juventud, vasta, lozana, amorosa'),(1273,29,27,NULL,'2022-12-16',2,'palabras;Aférrate','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1274,12,14,61,'2021-04-03',2,'atierrasy','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1275,29,25,316,'2020-11-23',1,'cuántas','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1276,42,19,NULL,'2022-11-29',0,'capaz','Dejo las invocacionesde los famosos poetasy oradores'),(1277,12,19,771,'2023-06-23',1,'fuegos','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1278,33,2,70,'2021-09-02',2,'bien,amor','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1279,13,20,320,'2023-08-01',2,'así','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1280,28,20,622,'2020-11-30',1,'y','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1281,38,24,NULL,'2020-03-25',3,'anhelo.Y','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1282,6,5,1041,'2021-09-12',0,'con','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1283,32,23,497,'2020-05-22',2,'no','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1284,18,3,1267,'2023-09-02',0,'de','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1285,17,19,NULL,'2021-03-23',1,'cabeza','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1286,40,14,369,'2021-10-24',0,'de','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1287,20,12,247,'2022-03-12',3,'espejo','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1288,7,14,362,'2023-01-22',3,'un','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1289,42,10,1103,'2021-07-12',4,'más,amor','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1290,50,22,NULL,'2023-05-28',0,'acordadoda','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1291,39,8,NULL,'2023-09-11',4,'la','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1292,11,17,494,'2022-09-29',1,'vida','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1293,30,15,152,'2021-06-28',3,'noche','Yo no sé de pájaros,'),(1294,14,23,687,'2022-05-11',1,'mi','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1295,45,3,314,'2023-11-29',2,'dice','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1296,33,26,1032,'2023-04-25',0,'abatidosque','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1297,4,18,NULL,'2020-01-16',1,'excelentes,tantos','El amor existecomo un fuegopara abrasar en su bellezatoda la fealdad del mundo.'),(1298,16,23,825,'2023-03-15',2,'transformarloen','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1299,40,19,201,'2023-12-16',3,'sabes?El','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1300,14,15,1252,'2021-12-07',1,'más:','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1301,1,12,163,'2020-05-07',2,'llevados','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1302,42,3,953,'2022-07-26',2,'y','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1303,30,21,335,'2022-06-10',1,'duró','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1304,2,13,996,'2023-12-19',3,'historia','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(1305,49,11,1300,'2021-12-07',1,'para','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(1306,29,18,148,'2023-07-26',0,'ciencia','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1307,49,13,1151,'2023-07-20',1,'dulces','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1308,36,4,NULL,'2021-08-22',2,'ciruelono','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1309,13,21,NULL,'2020-03-26',1,'amor','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1310,9,4,655,'2022-04-06',0,'hablo','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1311,49,19,682,'2020-10-08',0,'el','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1312,15,9,973,'2022-03-07',1,'honrosos,que','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1313,23,14,135,'2022-01-02',3,'famosoen','¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1314,12,11,578,'2023-02-15',2,'edificios','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1315,31,24,200,'2020-02-28',1,'Esperanza.','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1316,47,9,249,'2023-05-30',0,'claras','Por una mirada, un mundo'),(1317,22,1,866,'2022-11-23',3,'separade','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1318,38,27,904,'2023-01-24',2,'tiempoque','El Agua se conoce por la sed'),(1319,49,15,1155,'2021-11-21',2,'y','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1320,28,3,594,'2020-07-07',1,'nos','Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(1321,28,12,NULL,'2022-12-20',0,'ardeuna','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1322,32,18,NULL,'2023-12-19',2,'nuestro','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1323,30,1,NULL,'2022-01-20',0,'corazón(lo','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1324,7,21,970,'2023-01-09',1,'gran','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1325,49,16,1253,'2023-11-18',2,'donde','no sabrán nunca que nos hemos ido.'),(1326,6,8,430,'2022-06-09',2,'una','Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(1327,28,1,1224,'2021-02-05',0,'la','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1328,30,21,246,'2020-10-08',1,'mismos!;Ten','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1329,50,16,NULL,'2022-12-10',1,'ni','cuán presto se va el placer'),(1330,32,22,1203,'2020-04-03',1,'en','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(1331,25,9,NULL,'2022-09-07',2,'el','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1332,24,12,NULL,'2021-08-09',0,'luegoen','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1333,46,3,1101,'2020-04-21',0,'Ocañavino','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1334,28,16,197,'2021-06-15',0,'lenguaje.;Lo','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1335,3,7,NULL,'2021-04-25',3,'los','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(1336,14,24,1129,'2023-10-30',0,'superior','El amor existecomo un fuegopara abrasar en su bellezatoda la fealdad del mundo.'),(1337,25,27,38,'2021-12-02',2,'deidad.;Este','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(1338,9,12,358,'2023-01-21',2,'díasque','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1339,24,13,NULL,'2021-05-24',1,'el','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1340,29,22,NULL,'2022-06-02',0,'no','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1341,20,17,923,'2021-05-22',0,'los','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1342,16,11,NULL,'2023-12-19',0,'de','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1343,19,15,380,'2021-11-02',0,'sin','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1344,9,3,NULL,'2023-08-26',0,'echarla.Tan','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(1345,37,9,567,'2021-12-03',0,'arranca','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1346,15,8,NULL,'2021-12-25',2,'al','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1347,7,11,1255,'2020-11-01',1,'yermocubierto','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1348,36,21,NULL,'2023-03-26',1,'cercos','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(1349,9,22,72,'2023-01-30',3,'guerrasy','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1350,47,8,NULL,'2020-03-18',3,'a','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1351,34,8,1022,'2021-08-17',2,'rienda','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1352,31,16,NULL,'2021-07-09',1,'natural','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1353,42,23,478,'2022-06-04',4,'fue','Dejo las invocacionesde los famosos poetasy oradores'),(1354,12,7,NULL,'2023-04-21',1,'en','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1355,9,5,NULL,'2020-08-21',2,'secarse','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(1356,31,9,734,'2020-10-07',1,'con','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1357,11,6,969,'2021-02-01',2,'en','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1358,13,11,481,'2023-05-14',0,'vos,','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1359,4,12,280,'2023-01-19',1,'tus','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1360,7,24,615,'2023-01-15',0,'cuello','Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(1361,30,22,146,'2022-01-25',0,'caricias.;¿Qué','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1362,39,2,535,'2023-09-21',1,'del','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1363,14,18,NULL,'2020-06-14',1,'la','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1364,34,16,854,'2022-12-08',2,'o','dejemos a los romanos,aunque oímos y leímossus historias'),(1365,30,23,924,'2023-02-11',3,'tiene','Se extingue el díapero no el canto de la alondra'),(1366,9,18,525,'2023-01-29',2,'de','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1367,13,26,NULL,'2023-09-20',0,'que','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1368,2,4,756,'2022-06-05',1,'pechos','vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(1369,11,23,243,'2023-12-06',2,'sí,','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1370,48,4,691,'2020-09-24',3,'minuto','por un beso… yo no séqué te diera por un beso.'),(1371,12,4,393,'2021-06-16',1,'el','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1372,47,9,840,'2022-04-15',1,'a','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1373,35,19,1360,'2023-01-15',1,'y','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1374,34,25,474,'2022-08-05',1,'es','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1375,31,13,619,'2022-05-21',2,'eres,','Se extingue el díapero no el canto de la alondra'),(1376,24,4,1342,'2023-12-19',2,'aquelque','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1377,7,24,1303,'2022-06-10',4,'tan','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1378,20,27,NULL,'2020-11-19',4,'ser','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1379,31,21,NULL,'2021-08-11',6,'pensamiento','después de tan bien servidala corona de su reyverdadero'),(1380,46,6,243,'2022-10-11',2,'dulces','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1381,36,1,34,'2023-05-20',2,'volar.Aférrate','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1382,22,3,850,'2023-08-30',3,'fuerza','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(1383,23,11,NULL,'2021-03-05',2,'creyendo','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1384,20,24,799,'2020-03-10',1,'gaviotas;Por','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1385,13,4,400,'2022-03-09',0,'azar','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1386,14,15,809,'2021-09-19',5,'cuenta','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1387,13,20,549,'2021-07-01',2,'árbol','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(1388,40,2,419,'2022-03-16',2,'total','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1389,36,20,NULL,'2023-06-30',1,'componer','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1390,7,19,NULL,'2021-07-25',1,'jaeces','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1391,24,2,1323,'2020-09-27',3,'moros.;Y','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1392,25,12,226,'2022-11-20',0,'regañas','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1393,34,23,29,'2023-10-10',3,'nos','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1394,40,25,NULL,'2022-03-24',1,'no','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1395,18,4,85,'2021-03-26',3,'lo','Ponerlo todo en duda es el único modo de ordenarme'),(1396,23,2,NULL,'2022-03-15',1,'caudales,allí','y llegados, son igualeslos que viven por sus manosy los ricos.'),(1397,35,23,1193,'2023-11-09',1,'en','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1398,34,3,NULL,'2022-11-09',1,'huesacon','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1399,24,26,1150,'2021-04-11',0,'ojos','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1400,37,5,NULL,'2022-11-26',0,'de','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1401,25,12,139,'2021-02-14',1,'cuando','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1402,38,1,NULL,'2021-06-17',1,'gente?Mi','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1403,42,18,NULL,'2022-03-22',2,'más','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1404,37,25,1232,'2022-06-29',2,'estoyen','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1405,30,4,1208,'2023-03-29',1,'sólo','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1406,33,26,1098,'2021-06-03',3,'sea','por una sonrisa, un cielo'),(1407,18,7,NULL,'2022-09-19',1,'y','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(1408,20,23,148,'2020-05-13',1,'amar,','Yo no sé de pájaros,'),(1409,29,2,1302,'2022-07-26',3,'cuando','En tus ojos nazco, -tus ojos me crean,vivo yo en tus ojos -el sol de mi esfera,en tus ojos muero, -mi casa y vereda,tus ojos mi tumba, -tus ojos mi tierra.'),(1410,32,23,819,'2021-08-04',1,'inmenso,','Juventud, vasta, lozana, amorosa'),(1411,34,18,199,'2021-07-03',3,'esos','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1412,7,1,NULL,'2020-07-20',0,'cariño','Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(1413,17,24,1251,'2021-01-25',4,'ya','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1414,29,15,373,'2023-08-15',1,'alegría,En','y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1415,29,10,551,'2020-03-23',2,'lágrimas,silencio','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1416,42,23,669,'2020-11-19',1,'pasado,qué','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1417,47,18,1118,'2020-12-27',1,'yerbas','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(1418,44,21,NULL,'2022-11-28',1,'ti,','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1419,49,22,10,'2020-04-07',1,'o','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1420,20,19,957,'2022-12-19',3,'en','por una sonrisa, un cielo'),(1421,37,21,1404,'2021-12-22',1,'ti','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1422,3,13,1097,'2022-09-06',2,'se','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1423,2,22,159,'2020-05-24',1,'¡serás','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1424,45,12,NULL,'2022-12-20',1,'cava','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(1425,35,5,1420,'2022-12-19',2,'gracia,','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1426,6,8,NULL,'2022-11-11',0,'por','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1427,21,20,1108,'2022-02-28',2,'dolor;cómo','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1428,16,18,433,'2023-07-01',1,'ayery','así que, cuando morimos,descansamos.'),(1429,2,14,NULL,'2022-04-26',0,'de','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1430,43,14,NULL,'2020-11-01',3,'el','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(1431,6,7,285,'2022-03-21',1,'placerenroscados','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(1432,35,8,675,'2023-12-28',3,'se','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1433,30,12,1201,'2023-04-20',1,'a','y llegados, son igualeslos que viven por sus manosy los ricos.'),(1434,14,9,NULL,'2023-05-30',0,'sueños','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1435,47,17,235,'2020-02-12',2,'huesacon','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(1436,13,23,562,'2022-11-03',1,'a','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1437,18,20,NULL,'2020-01-25',1,'AurelianoMarco','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1438,13,6,NULL,'2023-01-02',3,'una','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1439,49,2,370,'2020-10-04',3,'yode','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1440,38,8,1393,'2023-10-10',5,'se','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1441,8,27,864,'2020-09-11',0,'los','Podrá nublarse el sol eternamente'),(1442,42,20,1012,'2022-08-25',5,'que','Podrá nublarse el sol eternamente'),(1443,4,6,323,'2022-03-12',1,'que','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1444,7,12,957,'2021-07-07',0,'o','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1445,6,23,998,'2021-01-23',2,'a','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1446,26,20,1026,'2022-11-27',1,'ojos','Juventud, vasta, lozana, amorosa'),(1447,46,19,NULL,'2020-08-02',3,'de','Se extingue el díapero no el canto de la alondra'),(1448,47,3,373,'2021-12-05',1,'cristal.¡todo','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1449,30,22,1104,'2022-10-19',1,'siguió!Mas','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1450,7,12,1123,'2021-04-12',0,'gravezacuando','el olvido es la única venganzay el único perdón.'),(1451,19,17,NULL,'2023-05-26',1,'¿dó','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1452,12,7,NULL,'2022-09-16',2,'y','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(1453,18,25,405,'2021-04-05',3,'al','así que, cuando morimos,descansamos.'),(1454,21,18,143,'2022-01-18',2,'dio!;Las','Dejo las invocacionesde los famosos poetasy oradores'),(1455,50,26,362,'2021-02-27',3,'cuando','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1456,6,19,915,'2021-12-02',2,'las','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(1457,4,9,1386,'2021-09-19',0,'esperar','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1458,4,5,NULL,'2023-10-04',2,'y','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1459,43,23,64,'2022-05-26',2,'sos','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1460,14,23,253,'2022-07-04',0,'que','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1461,7,3,935,'2020-03-18',1,'sumo','Se extingue el díapero no el canto de la alondra'),(1462,27,25,874,'2023-05-17',1,'batallar,En','Esta noche al oído me has dicho dos palabrasComunes. Dos palabras cansadasDe ser dichas. Palabras que de viejas son nuevas.Dos palabras tan dulces, que la luna que andabaFiltrando entre las ramasSe detuvo en mi boca. Tan dulces dos palabrasQue una hormiga pasea por mi cuello y no intentoMoverme para echarla.Tan dulces dos palabrasQuq digo sin quererlo- ¡oh, qué bella, la vida!-Tan dulces y tan mansasQue aceites olorosos sobre el cuerpo derraman.Tan dulces y tan bellasQue los dedos más largos de mi mano derechaSe mueven hacia el cielo imitando tijeras.Oh, mis dedos quisieranCortar estrellas.'),(1463,11,14,1069,'2022-07-29',0,'estas','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(1464,30,5,1306,'2023-03-16',1,'tener','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1465,11,5,NULL,'2020-03-13',1,'ver','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1466,34,1,686,'2020-08-16',1,'necesites.;¿Mi','Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(1467,3,10,NULL,'2021-01-14',1,'conozco','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(1468,48,7,823,'2023-05-19',3,'táctica','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1469,29,15,803,'2022-05-18',3,'mañana.Y','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1470,15,17,884,'2023-03-04',2,'tanto','Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(1471,31,7,1304,'2022-09-07',0,'de','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1472,15,13,155,'2021-07-20',2,'sangre','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1473,20,2,1123,'2023-06-27',1,'tiempo','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1474,26,11,307,'2023-05-28',3,'nuevo','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1475,14,13,502,'2023-07-02',1,'aquel','Dejo las invocacionesde los famosos poetasy oradores'),(1476,33,18,NULL,'2020-11-18',1,'los','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1477,40,5,1047,'2021-01-17',5,'anunciaban','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1478,12,2,NULL,'2023-11-23',1,'puedes','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1479,30,27,NULL,'2023-06-28',0,'dela','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1480,7,6,1458,'2023-08-18',1,'ya','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1481,30,27,158,'2020-10-03',6,'que','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1482,39,9,NULL,'2022-08-15',0,'daño,corremos','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1483,26,18,665,'2020-01-11',0,'revés.;En','no sabrán nunca que nos hemos ido.'),(1484,1,4,547,'2023-12-06',2,'amanezcan','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1485,4,14,1360,'2020-06-22',2,'cosa','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1486,25,9,10,'2020-07-25',2,'lejanía,pero','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1487,38,12,706,'2021-02-26',1,'el','Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(1488,18,15,889,'2022-10-14',0,'el','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1489,21,17,732,'2020-06-20',2,'crece','Este mundo es el caminopara el otro, que es moradasin pesar'),(1490,6,26,322,'2022-05-15',0,'es','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1491,30,6,NULL,'2022-05-10',2,'mi','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1492,31,8,401,'2023-12-26',2,'por','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1493,24,25,277,'2023-03-29',2,'sabores.A','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1494,16,22,NULL,'2023-02-25',0,'airete','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1495,50,12,924,'2023-07-23',0,'vasallosque','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1496,29,8,NULL,'2023-08-09',1,'debilidadesy','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1497,13,10,1316,'2023-05-30',1,'guerraque','¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1498,28,22,643,'2021-09-21',5,'amor','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1499,44,27,1167,'2020-10-27',0,'firmeza,pues','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1500,48,27,NULL,'2022-10-07',0,'tener','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1501,3,8,NULL,'2020-11-27',0,'aquello.;¿Qué','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1502,48,1,357,'2021-06-18',4,'es','En tus ojos nazco, -tus ojos me crean,vivo yo en tus ojos -el sol de mi esfera,en tus ojos muero, -mi casa y vereda,tus ojos mi tumba, -tus ojos mi tierra.'),(1503,18,4,707,'2023-03-20',2,'en','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1504,33,23,659,'2022-12-06',1,'se','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(1505,42,13,676,'2023-05-14',1,'falta','dejemos a los romanos,aunque oímos y leímossus historias'),(1506,16,7,148,'2023-12-20',0,'tiene','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(1507,45,9,1048,'2021-01-26',1,'cómoni','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1508,28,26,725,'2023-09-13',1,'nos','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1509,9,21,527,'2022-11-27',2,'su','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1510,42,27,NULL,'2021-02-11',2,'compartir','En tus ojos nazco, -tus ojos me crean,vivo yo en tus ojos -el sol de mi esfera,en tus ojos muero, -mi casa y vereda,tus ojos mi tumba, -tus ojos mi tierra.'),(1511,49,3,323,'2021-03-11',3,'tu','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1512,6,23,1000,'2021-05-19',2,'se','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1513,11,26,NULL,'2022-04-08',2,'ser','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1514,48,24,860,'2020-03-29',2,'donde','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1515,28,18,1464,'2023-03-01',3,'rienda','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1516,3,16,1023,'2020-06-20',0,'las','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1517,39,12,936,'2020-04-11',0,'nubarrones,si','La tierra ensucia las manospero limpia al hombre.'),(1518,20,15,120,'2020-12-23',1,'no',' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(1519,7,9,NULL,'2020-06-29',3,'lozana,','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1520,39,13,831,'2023-12-24',1,'ardeuna','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1521,26,21,NULL,'2022-11-28',1,'corazón','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1522,3,3,NULL,'2023-01-05',1,'cuando','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(1523,46,17,210,'2023-04-02',1,'tardesin','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(1524,18,14,554,'2020-02-26',0,'en','Tú que tan grandes tormentossufriste sin resistenciaen tu persona,no por mis merecimientos,mas por tu sola clemencia,me perdona.'),(1525,40,21,574,'2022-10-09',2,'explicar','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1526,6,26,33,'2022-05-04',0,'dócil','así que, cuando morimos,descansamos.'),(1527,9,7,985,'2021-10-30',1,'sangre','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1528,29,14,845,'2023-12-13',1,'es','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1529,26,11,1045,'2021-03-05',2,'sombra…Si','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1530,21,25,1468,'2023-05-19',3,'largos','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1531,26,8,542,'2022-10-22',1,'dél,como','Cuando pasen los años, cuando pasenlos años y el aire haya cavado un fosoentre tu alma y la mía'),(1532,4,24,1496,'2020-09-26',1,'tan','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(1533,27,3,1041,'2022-12-27',1,'sabery','no conozco la historia del fuego.'),(1534,6,3,NULL,'2020-11-06',2,'edad,de','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(1535,25,22,1433,'2023-04-20',2,'y,quizá','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(1536,33,24,1323,'2022-01-20',1,'vivatuviéramos','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1537,13,20,NULL,'2023-08-11',0,'con','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1538,48,20,NULL,'2021-04-14',1,'el','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1539,17,20,490,'2023-09-29',3,'de','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1540,34,18,1399,'2021-04-11',2,'llama','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1541,8,12,350,'2022-09-06',1,'los','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1542,26,22,1126,'2023-10-10',1,'día','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(1543,29,15,124,'2022-10-11',0,'sólo','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1544,45,20,635,'2020-01-11',1,'tan','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1545,33,23,465,'2022-04-05',5,'el','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1546,12,16,941,'2020-11-30',2,'el','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1547,48,1,1336,'2021-05-10',1,'bellezaporque','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(1548,36,15,994,'2020-04-03',4,'que','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1549,10,1,433,'2023-11-21',2,'malo,una','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1550,5,26,1020,'2022-12-30',0,'morir:allí','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1551,48,24,339,'2021-05-13',1,'trabajar,En','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1552,20,22,535,'2021-12-21',0,'malos','no conozco la historia del fuego.'),(1553,23,11,NULL,'2022-07-22',0,'amores','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1554,42,22,661,'2022-01-15',0,'toda','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(1555,34,1,600,'2020-12-14',5,'es','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1556,26,6,1376,'2023-12-19',1,'mundodonde','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1557,15,19,157,'2020-10-21',0,'heridas.Es','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1558,46,14,650,'2022-06-22',0,'y','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1559,9,13,NULL,'2021-06-13',3,'cuán','el olvido es la única venganzay el único perdón.'),(1560,19,25,767,'2022-05-04',2,'siglo','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(1561,14,10,25,'2022-03-25',3,'llevo','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1562,31,4,NULL,'2023-04-09',0,'famososhizo','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1563,37,6,514,'2022-07-11',3,'anunciaban','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1564,34,15,597,'2022-03-02',2,'vieja','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1565,14,3,NULL,'2020-02-07',3,'callado.;Se','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1566,6,25,807,'2022-11-16',0,'liberarnos','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1567,23,20,NULL,'2021-02-09',2,'y','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1568,34,5,1148,'2020-05-02',1,'buen','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(1569,39,13,1209,'2023-11-15',4,'conocimos,tan','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1570,5,21,1336,'2023-01-30',3,'más','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1571,48,18,NULL,'2023-01-05',1,'subiday','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1572,26,16,NULL,'2021-10-12',1,'más','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1573,46,15,1004,'2021-02-23',2,'muerenla','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1574,27,2,NULL,'2022-07-29',2,'el','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1575,41,17,1307,'2023-07-20',5,'te','Este mundo es el caminopara el otro, que es moradasin pesar'),(1576,3,26,146,'2021-01-06',2,'puedes','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1577,31,8,NULL,'2023-05-16',3,'ninguno','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1578,36,22,874,'2023-10-26',4,'se','Cuando pasen los años, cuando pasenlos años y el aire haya cavado un fosoentre tu alma y la mía'),(1579,14,8,627,'2021-09-01',1,'crespón;Pero','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1580,9,11,1480,'2023-08-18',1,'amorabandonamos',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1581,15,27,1490,'2022-05-15',2,'la','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1582,32,19,1201,'2020-03-22',3,'más','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1583,34,2,132,'2020-02-21',2,'de','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1584,37,27,NULL,'2022-09-07',4,'grito','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1585,45,23,1531,'2022-10-22',2,'una','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1586,3,22,1373,'2023-01-15',1,'nos','cuán presto se va el placer'),(1587,19,5,503,'2021-02-07',2,'divinapara','Yo no hablo de venganzas ni de perdones'),(1588,45,2,NULL,'2022-08-21',1,'de','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1589,21,3,NULL,'2021-11-14',2,'Dios','cómo después de acordadoda dolor'),(1590,48,15,846,'2021-04-16',2,'realesllenos','por un beso… yo no séqué te diera por un beso.'),(1591,12,2,1525,'2020-11-12',0,'certidumbre','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1592,39,13,1113,'2020-01-29',2,'insistencia,','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1593,46,12,NULL,'2021-01-04',0,'Podrá','Se extingue el díapero no el canto de la alondra'),(1594,27,12,NULL,'2022-03-12',0,'toda','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1595,44,16,1407,'2021-12-24',4,'de','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1596,18,14,614,'2021-11-22',0,'falta','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1597,43,6,NULL,'2020-07-01',1,'olvido','Cuando pasen los años, cuando pasenlos años y el aire haya cavado un fosoentre tu alma y la mía'),(1598,17,12,746,'2022-09-23',1,'terrenal,perecedera.;El','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1599,43,10,1040,'2023-08-30',3,'camino,ni','Se extingue el díapero no el canto de la alondra'),(1600,10,16,NULL,'2023-05-15',0,'nombre','Podrá secarse en un instante el mar'),(1601,20,26,660,'2020-07-10',0,'como','Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(1602,26,17,1005,'2021-04-06',1,'el','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1603,49,2,521,'2020-12-02',0,'los','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(1604,4,7,926,'2020-02-05',3,'total','Hay besos que producen desvaríosde amorosa pasión ardiente y loca,tú los conoces bien son besos míosinventados por mí, para tu boca.'),(1605,28,13,266,'2022-07-25',0,'su','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1606,35,24,154,'2023-06-07',2,'este','el olvido es la única venganzay el único perdón.'),(1607,35,1,NULL,'2020-10-15',2,'inconquistable.En','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(1608,28,24,760,'2022-10-08',1,'engañosoy','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1609,3,11,101,'2022-07-10',1,'buenos','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1610,1,9,NULL,'2023-08-10',2,'el','no conozco la historia del fuego.'),(1611,48,7,1449,'2021-03-09',1,'que','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1612,37,2,780,'2020-11-02',1,'la','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1613,28,1,443,'2022-01-28',1,'y','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1614,43,14,NULL,'2023-11-09',1,'amuleto.;Si','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1615,43,11,62,'2021-11-03',0,'de','allí los ríos caudales,allí los otros medianosy más chicos'),(1616,22,14,NULL,'2023-01-28',0,'nidoLo','y llegados, son igualeslos que viven por sus manosy los ricos.'),(1617,44,3,796,'2022-01-18',3,'cumple','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1618,15,22,811,'2022-03-20',0,'el','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1619,18,16,1102,'2022-10-10',1,'el','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1620,34,25,1174,'2022-10-21',0,'cosas','allí los ríos caudales,allí los otros medianosy más chicos'),(1621,19,9,479,'2020-02-22',0,'alas,','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(1622,24,2,NULL,'2020-02-25',1,'que','Podrá nublarse el sol eternamente'),(1623,9,11,868,'2023-02-23',3,'bella,','Podrá nublarse el sol eternamente'),(1624,22,20,NULL,'2021-07-19',2,'riqueza,que','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1625,4,13,387,'2021-04-25',2,'va','por una sonrisa, un cielo'),(1626,4,6,NULL,'2022-07-24',0,'que','Juventud, vasta, lozana, amorosa'),(1627,48,1,380,'2023-11-02',0,'¿dó','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1628,28,26,1034,'2020-07-29',0,'mi','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1629,20,10,1387,'2021-02-20',2,'en','Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1630,7,22,1573,'2021-02-23',0,'que','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1631,38,6,1287,'2022-03-12',0,'a','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1632,15,13,471,'2022-04-30',0,'todo','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1633,14,5,444,'2022-09-08',3,'fantasma,te','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1634,22,13,770,'2023-11-15',2,'llamar','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1635,32,4,1468,'2021-03-30',3,'en','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(1636,11,2,703,'2023-09-10',2,'pareja','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1637,13,25,NULL,'2021-06-02',1,'resistenciaen','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1638,31,4,1408,'2020-05-13',2,'húmeda','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1639,40,13,334,'2022-09-20',1,'viejo','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1640,41,7,91,'2021-11-16',2,'al','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(1641,12,14,1580,'2023-06-04',1,'a','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1642,12,14,NULL,'2023-01-04',0,'fino!,','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1643,50,24,512,'2020-02-24',0,'mi','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(1644,11,12,561,'2020-02-23',1,'en','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1645,40,11,1295,'2022-04-25',3,'estrategia','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1646,21,18,839,'2022-02-27',1,'olores?¿Qué','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1647,21,11,574,'2021-01-03',3,'que','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1648,21,11,589,'2021-07-17',0,'fragua,¡oh','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(1649,31,20,171,'2021-02-23',2,'tus','Juventud, vasta, lozana, amorosa'),(1650,42,13,403,'2020-11-21',2,'ciencia','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1651,1,25,1556,'2020-02-11',4,'la','Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(1652,36,18,1363,'2020-05-17',2,'perdemos.De','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1653,50,23,268,'2021-02-07',3,'sufrir','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1654,35,5,1641,'2023-03-17',2,'muramoslas','Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(1655,33,19,NULL,'2021-03-17',0,'franja','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1656,10,24,596,'2020-12-15',1,'los','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1657,7,15,872,'2021-06-10',3,'pájaroy','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1658,40,9,832,'2023-04-21',1,'gente,','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1659,48,2,63,'2021-02-04',0,'puede','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(1660,23,27,985,'2021-07-19',1,'de','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1661,24,3,1023,'2021-12-20',3,'cobró.Pues','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1662,5,7,452,'2021-12-20',1,'despertara','Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1663,13,26,1022,'2021-11-22',5,'placer;cómo','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1664,15,6,1497,'2022-12-20',1,'una','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1665,21,7,208,'2022-12-09',1,'','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1666,24,12,768,'2022-11-29',2,'posa','Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1667,23,26,NULL,'2020-02-22',2,'conociósu','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1668,2,11,784,'2022-10-11',1,'de','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1669,23,3,1305,'2021-10-28',1,'ancho','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(1670,32,10,1374,'2022-08-05',3,'fuese','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1671,5,22,59,'2021-04-01',4,'vida','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1672,43,11,614,'2023-10-22',0,'lo','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(1673,48,17,1397,'2023-11-09',0,'de','Por una mirada, un mundo'),(1674,18,6,1221,'2020-11-25',4,'pertenece','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(1675,14,13,1365,'2023-02-11',4,'mi','vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(1676,17,20,1011,'2021-01-04',0,'ti','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1677,21,3,1545,'2022-04-05',2,'en','por una sonrisa, un cielo'),(1678,50,15,148,'2023-05-30',2,'encontrarel','Ponerlo todo en duda es el único modo de ordenarme'),(1679,4,20,NULL,'2020-10-17',1,'el','Este mundo es el caminopara el otro, que es moradasin pesar'),(1680,47,7,721,'2020-05-14',1,'ser','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1681,39,5,1588,'2020-06-09',2,'mundo','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1682,34,7,806,'2021-04-13',3,'boca.','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1683,29,10,1298,'2023-03-15',0,'con','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1684,3,10,742,'2020-03-03',2,'o','Yo no sé de pájaros,'),(1685,34,27,770,'2021-06-17',1,'es','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1686,20,24,NULL,'2023-06-21',0,'los','¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1687,48,17,956,'2023-09-08',2,'la','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1688,32,6,168,'2023-09-26',0,'propias','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1689,22,25,NULL,'2020-01-27',3,'sino','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1690,9,14,1095,'2022-11-18',0,'comiences.Si','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(1691,49,19,661,'2023-06-30',3,'regalo','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1692,39,22,492,'2022-01-22',3,'la','Ponerlo todo en duda es el único modo de ordenarme'),(1693,14,15,1542,'2021-02-16',0,'esforzadosy','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1694,12,1,11,'2021-05-14',1,'abierta!…Si','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1695,50,15,NULL,'2020-03-30',1,'las','Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1696,38,19,NULL,'2023-07-02',0,'sueñosporque','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(1697,46,4,841,'2022-09-13',0,'el','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1698,9,20,1562,'2022-02-05',1,'quedaaprovechemos','Podrá secarse en un instante el mar'),(1699,42,11,NULL,'2022-02-02',4,'claro','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1700,16,14,119,'2022-12-19',0,'vida!-Tan','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1701,41,20,1176,'2023-04-18',2,'que','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1702,39,5,1438,'2023-01-02',1,'si','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1703,50,2,NULL,'2022-04-11',1,'dicho.Después','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1704,40,21,1558,'2022-05-06',4,'vencida.;Más','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1705,7,7,NULL,'2023-03-04',2,'Vida','Se extingue el díapero no el canto de la alondra'),(1706,9,26,1424,'2020-07-29',1,'vivir','Podrá nublarse el sol 