s malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1718,33,18,1172,'2020-05-11',1,'esen','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1719,41,17,NULL,'2021-11-16',2,'golpes','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1720,10,27,1616,'2023-01-28',1,'no','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1721,34,24,58,'2020-04-11',0,'afrentaque','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1722,30,23,NULL,'2020-01-16',1,'le','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1723,32,1,NULL,'2021-05-24',1,'lobito','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1724,6,21,1284,'2023-03-03',1,'vuelve.Que','así que, cuando morimos,descansamos.'),(1725,46,16,1445,'2020-09-01',1,'amadores?¿Qué','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1726,30,25,883,'2023-10-18',3,'y','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1727,17,7,NULL,'2022-05-17',1,'el','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1728,19,23,1578,'2023-10-26',6,'huesacon','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1729,30,21,NULL,'2022-04-07',1,'tratar','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1730,22,16,NULL,'2021-10-11',3,'Octaviano,Julio','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1731,22,4,815,'2021-09-08',0,'de','ninguno de nosotros la formula ni crea.sentimos que hay un algo superior que nos guíay logra la unidad de nuestra compañía...Y nos vemos llevados a pensar con hondura,y a lograr certidumbre en la vida insegura'),(1732,46,19,877,'2022-03-29',0,'amor','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1733,8,27,NULL,'2023-08-21',4,'saber','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1734,30,19,1031,'2022-12-04',2,'como','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1735,19,18,1476,'2020-07-17',2,'embargo','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1736,44,25,NULL,'2023-09-03',1,'los','Podrá secarse en un instante el mar'),(1737,43,15,741,'2023-04-05',1,'de','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1738,10,27,NULL,'2021-05-13',1,'arenasin','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(1739,2,24,1024,'2022-12-25',0,'en','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1740,46,15,60,'2022-05-06',2,'villas.Y','por un beso… yo no séqué te diera por un beso.'),(1741,31,24,NULL,'2020-10-06',1,'vida','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1742,43,7,750,'2020-04-28',3,'y','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1743,19,3,NULL,'2020-04-25',1,'están','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1744,5,27,1085,'2020-11-12',0,'la',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1745,19,9,NULL,'2023-06-13',1,'conocimos,tan','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(1746,11,21,1641,'2023-06-04',0,'perdona.;Así,','Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(1747,17,7,1706,'2020-07-29',0,'no','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(1748,37,15,NULL,'2022-10-12',0,'espejo','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1749,32,25,1292,'2022-09-29',2,'abismosmi','El amor existecomo un fuegopara abrasar en su bellezatoda la fealdad del mundo.'),(1750,14,14,NULL,'2023-01-09',1,'una','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1751,43,3,1182,'2021-04-23',0,'tiranoslas','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1752,18,19,1707,'2020-10-23',2,'todo','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1753,36,22,1362,'2023-09-21',2,'fealdad','¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1754,23,8,NULL,'2022-12-08',3,'los','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1755,34,24,495,'2022-01-04',1,'no','Se extingue el díapero no el canto de la alondra'),(1756,15,15,1171,'2021-12-22',0,'golpes','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1757,16,15,NULL,'2023-05-01',0,'tierra.;No','Podrá nublarse el sol eternamente'),(1758,23,24,332,'2023-02-17',1,'tristeza.No','Podrá nublarse el sol eternamente'),(1759,43,17,1672,'2021-08-28',3,'y','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1760,12,13,1171,'2023-08-22',3,'este','Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(1761,23,3,349,'2021-02-07',2,'ya','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(1762,26,15,1510,'2021-02-11',1,'poesía?,','El Agua se conoce por la sed'),(1763,49,10,1374,'2021-07-30',0,'bien','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1764,25,17,NULL,'2022-08-28',2,'temo','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1765,31,2,NULL,'2023-10-04',0,'de','así que, cuando morimos,descansamos.'),(1766,12,6,703,'2020-08-03',4,'hable,sino','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1767,37,20,99,'2022-09-07',4,'nuestras','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1768,27,25,795,'2021-11-21',2,'que','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1769,39,25,NULL,'2021-09-12',2,'amar','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1770,17,11,1580,'2020-06-18',2,'los','Somos obras de arte momentáneamente vivientes.'),(1771,41,15,940,'2021-11-05',1,'la','Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1772,4,13,158,'2021-01-04',1,'engaños,o','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1773,49,5,1260,'2022-03-06',0,'no','Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1774,17,2,1163,'2020-10-30',3,'que','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1775,16,13,1396,'2022-03-15',2,'hablar','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1776,34,21,1740,'2022-05-06',1,'palabras,y','Somos obras de arte momentáneamente vivientes.'),(1777,46,22,1552,'2021-12-21',1,'la','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(1778,9,26,NULL,'2023-11-17',1,'la','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1779,46,5,770,'2023-07-12',1,'vivatuviéramos','cuán presto se va el placer'),(1780,29,1,836,'2021-07-08',3,'no','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1781,3,12,1663,'2021-06-11',0,'llave','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(1782,23,17,NULL,'2020-12-15',0,'desvaríosde','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(1783,43,6,NULL,'2022-01-23',1,'tan','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1784,13,18,NULL,'2020-06-18',1,'destinomi','Más allá de la noche que me cubre,negra como el abismo insondable,doy gracias al dios que fuerepor mi alma inconquistable.En las garras de las circunstanciasno he gemido ni llorado.Sometido a los golpes del destinomi cabeza sangra, pero está erguida.Más allá de este lugar de ira y llantosdonde yace el horror de la sombra,la amenaza de los añosme halla, y me hallará sin temor.No importa cuán estrecho sea el camino,ni cuán cargada de castigos la sentencia,soy el amo de mi destino,soy el capitán de mi alma.'),(1785,27,1,1308,'2021-08-22',2,'como','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1786,7,21,NULL,'2020-06-15',2,'sutil,Tu','no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(1787,32,2,181,'2023-12-19',0,'están','¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1788,14,20,803,'2022-06-22',1,'los','La tierra ensucia las manospero limpia al hombre.'),(1789,16,11,NULL,'2021-05-09',1,'de','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1790,34,25,392,'2023-02-26',2,'una','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(1791,40,3,706,'2023-06-01',1,'perovence','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1792,39,18,NULL,'2023-06-02',0,'tres.;Alejarse','por una sonrisa, un cielo'),(1793,50,2,526,'2022-05-29',0,'mejor.;Pues','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1794,39,9,NULL,'2021-02-27',1,'en','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1795,42,21,472,'2020-06-10',1,'con','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1796,50,20,33,'2020-02-12',0,'el','La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1797,22,25,883,'2021-10-04',1,'los','Ponerlo todo en duda es el único modo de ordenarme'),(1798,18,3,1764,'2022-03-10',2,'más','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1799,22,10,755,'2022-09-10',2,'mi','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1800,30,25,109,'2021-12-03',3,'soy','Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1801,3,18,1434,'2022-04-03',1,'todo.Y','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1802,9,22,1136,'2023-04-15',1,'aquello','Después de puesta la vidatantas veces por su leyal tablero'),(1803,5,10,NULL,'2023-05-20',2,'noche','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(1804,46,6,358,'2022-08-06',1,'no','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1805,13,27,975,'2020-10-29',1,'hondo,compacto','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1806,28,2,689,'2023-07-09',2,'tuyo.Por','cuán presto se va el placer'),(1807,39,23,190,'2020-02-24',1,'rechazo','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(1808,15,19,984,'2020-08-22',2,'vida','Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(1809,13,25,620,'2020-11-14',2,'que','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(1810,33,8,1484,'2023-12-06',1,'vuelve.Miras','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(1811,46,13,451,'2023-06-12',1,'mi','dejemos a los romanos,aunque oímos y leímossus historias'),(1812,25,21,1047,'2022-09-11',0,'tan','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1813,16,16,1118,'2022-01-02',3,'y','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1814,46,24,1257,'2022-09-16',1,'de','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1815,43,26,1069,'2020-03-03',0,'nos','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1816,1,16,NULL,'2021-05-28',1,'nidoLo','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1817,36,25,1486,'2020-03-10',0,'Polvode','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1818,35,8,NULL,'2022-05-23',1,'noches','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1819,23,24,NULL,'2021-06-01',1,'bueno','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(1820,31,26,NULL,'2021-04-11',0,'bajo','Yo no sé de pájaros,'),(1821,29,26,1668,'2021-07-07',2,'dices','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1822,14,19,1456,'2021-03-30',4,'poder','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1823,14,23,1014,'2021-09-04',1,'me','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1824,29,6,151,'2022-12-24',1,'de','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(1825,34,5,1126,'2023-06-19',2,'pretendan','así que, cuando morimos,descansamos.'),(1826,20,25,1284,'2023-09-02',0,'el','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1827,50,4,1048,'2020-01-28',3,'frescode','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1828,5,12,1236,'2023-05-09',1,'esperar…','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1829,20,16,184,'2020-11-06',1,'noches','Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(1830,27,14,1240,'2021-08-03',1,'amigo','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1831,37,21,1337,'2021-12-02',2,'la','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1832,20,12,1466,'2020-08-16',1,'mundo','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(1833,44,27,1703,'2022-04-11',2,'tesoros,sus','Hay besos que producen desvaríosde amorosa pasión ardiente y loca,tú los conoces bien son besos míosinventados por mí, para tu boca.'),(1834,24,15,466,'2021-01-30',2,'dos','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(1835,19,18,591,'2021-07-18',2,'nuevo','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1836,25,23,NULL,'2023-04-27',0,'eshablartey','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1837,46,11,1032,'2020-04-11',2,'eshablartey','Nuestras vidas son los ríosque van a dar