 luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1846,34,15,1620,'2022-10-21',1,'debidosse','El amor existecomo un fuegopara abrasar en su bellezatoda la fealdad del mundo.'),(1847,17,27,369,'2020-07-01',4,'esta','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1848,32,17,1692,'2021-10-26',0,'o','Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(1849,14,17,549,'2021-02-16',3,'el','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1850,10,4,NULL,'2023-02-25',1,'moros','Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(1851,42,10,NULL,'2023-08-14',2,'no','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1852,37,9,274,'2020-02-14',3,'sus','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1853,6,25,1793,'2022-05-29',1,'brote','Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1854,50,16,1739,'2020-05-06',1,'es','Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1855,13,18,195,'2022-01-23',2,'fragilidad','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1856,33,27,870,'2021-06-17',1,'para','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1857,19,9,520,'2022-07-21',6,'en','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(1858,17,10,606,'2020-10-04',0,'yode','Recuerde el alma dormida,avive el seso y despiertecontemplandocómo se pasa la vida,cómo se viene la muertetan callando'),(1859,26,23,1186,'2023-10-01',0,'hicieron','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1860,47,2,NULL,'2023-08-03',2,'liberarnos','Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1861,36,7,1219,'2021-03-27',1,'por','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1862,35,27,1047,'2021-10-29',3,'estoy','Esta noche al oído me has dicho dos palabrasComunes. Dos palabras cansadasDe ser dichas. Palabras que de viejas son nuevas.Dos palabras tan dulces, que la luna que andabaFiltrando entre las ramasSe detuvo en mi boca. Tan dulces dos palabrasQue una hormiga pasea por mi cuello y no intentoMoverme para echarla.Tan dulces dos palabrasQuq digo sin quererlo- ¡oh, qué bella, la vida!-Tan dulces y tan mansasQue aceites olorosos sobre el cuerpo derraman.Tan dulces y tan bellasQue los dedos más largos de mi mano derechaSe mueven hacia el cielo imitando tijeras.Oh, mis dedos quisieranCortar estrellas.'),(1863,8,10,237,'2021-07-24',2,'esta','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1864,14,1,NULL,'2020-06-18',4,'en','En tus ojos nazco, -tus ojos me crean,vivo yo en tus ojos -el sol de mi esfera,en tus ojos muero, -mi casa y vereda,tus ojos mi tumba, -tus ojos mi tierra.'),(1865,50,15,NULL,'2023-08-09',1,'dicho','Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(1866,25,5,1294,'2022-04-14',1,'será','por un beso… yo no séqué te diera por un beso.'),(1867,2,11,305,'2023-06-15',0,'misma','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1868,38,6,1023,'2020-05-09',2,'la','por un beso… yo no séqué te diera por un beso.'),(1869,20,6,1279,'2023-08-01',1,'táctica','aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1870,19,24,1299,'2023-12-16',1,'tan','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1871,6,15,NULL,'2023-11-23',3,'ventura','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1872,43,8,1724,'2023-03-03',1,'guerrasy','Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(1873,44,2,NULL,'2022-07-09',1,'batallame','Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1874,42,18,809,'2020-12-26',1,'lo','Yo no hablo de venganzas ni de perdones'),(1875,33,17,883,'2020-02-19',1,'yaen','Podrá secarse en un instante el mar'),(1876,8,10,344,'2020-09-08',1,'vienen','Yo no hablo de venganzas ni de perdones'),(1877,41,24,NULL,'2020-09-13',1,'hace','Pero creo que mi soledad debería tener alas.'),(1878,36,13,943,'2023-11-25',2,'cansado','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1879,20,19,1128,'2020-01-12',0,'templo','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1880,13,15,782,'2021-05-30',2,'en','La tierra ensucia las manospero limpia al hombre.'),(1881,34,15,275,'2020-10-26',1,'sabes','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1882,2,14,1610,'2023-08-10',2,'los','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1883,28,18,1216,'2023-02-26',1,'se','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1884,2,3,1557,'2020-06-05',4,'será','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1885,34,9,1257,'2021-03-30',2,'y','Podrá nublarse el sol eternamente'),(1886,34,19,1448,'2020-07-01',2,'caídofruto,por','no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1887,8,13,1047,'2021-11-26',0,'tengan','Podrá secarse en un instante el mar'),(1888,30,24,608,'2020-03-17',3,'también','Juventud, vasta, lozana, amorosa'),(1889,21,2,NULL,'2022-05-12',2,'no','Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1890,40,23,1851,'2023-08-14',3,'incurres','allí los ríos caudales,allí los otros medianosy más chicos'),(1891,35,5,1750,'2020-08-16',2,'mi','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1892,24,1,NULL,'2020-04-30',1,'vuelta,no','Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(1893,24,19,NULL,'2023-10-02',0,'el','el olvido es la única venganzay el único perdón.'),(1894,5,24,846,'2020-01-12',3,'el','¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(1895,26,27,2,'2021-03-28',1,'ni','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1896,47,11,1712,'2023-04-23',3,'no','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1897,40,21,445,'2023-07-17',0,'una','Podrá nublarse el sol eternamente'),(1898,27,4,197,'2021-11-02',0,'emigranahora','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1899,33,2,573,'2022-04-08',2,'en','Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1900,30,16,NULL,'2020-08-02',2,'las','Dejo las invocacionesde los famosos poetasy oradores'),(1901,17,27,1348,'2022-10-14',1,'y,quizá','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(1902,36,27,1860,'2023-01-10',1,'es','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1903,44,13,977,'2020-04-08',3,'la','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1904,5,16,NULL,'2020-10-26',0,'mi','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1905,42,2,1109,'2021-08-06',3,'clavasen','Pues la sangre de los godos,el linaje y la noblezatan crecida,¡por cuántas vías y modosse sume su gran altezaen esta vida!Unos, por poco valer,¡por cuán bajos y abatidosque los tienen!Otros que, por no tener,con oficios no debidosse mantienen.'),(1906,50,6,NULL,'2022-09-27',2,'calienta','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1907,29,21,1062,'2022-09-09',0,'que','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1908,17,27,593,'2023-05-29',2,'su','Los placeres y dulzoresde esta vida trabajadaque tenemos,no son sino corredores,y la muerte, la celadaen que caemos:No mirando a nuestro daño,corremos a rienda sueltasin parar'),(1909,42,4,1404,'2022-06-29',1,'a','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1910,8,9,936,'2022-07-12',1,'valorson','o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(1911,17,8,1229,'2022-07-15',1,'y','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1912,27,3,NULL,'2022-11-16',2,'es','Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(1913,9,14,1882,'2022-09-11',0,'ningún','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1914,41,13,526,'2020-03-16',3,'el','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1915,5,14,1848,'2021-02-21',0,'se','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(1916,27,5,1712,'2022-03-16',1,'oh','no sabrán nunca que nos hemos ido.'),(1917,5,11,NULL,'2023-02-12',3,'sólo','Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(1918,21,4,1229,'2022-12-18',2,'-','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(1919,11,12,789,'2023-10-05',4,'los','Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1920,37,4,1207,'2023-10-03',1,'anhelo.Y','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1921,31,17,1585,'2021-04-28',1,'eres','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1922,41,16,NULL,'2021-05-11',2,'deber.;Hoy','Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1923,11,12,1070,'2021-02-22',2,'esta','el olvido es la única venganzay el único perdón.'),(1924,18,23,549,'2021-12-18',0,'tiene','Ved de cuán poco valorson las cosas tras que andamosy corremos,que en este mundo traidoraun primero que muramoslas perdemos.De ellas deshace la edad,de ellas casos desastradosque acaecen,de ellas, por su calidad,en los más altos estadosdesfallecen.'),(1925,39,14,476,'2022-08-22',1,'prosperadoscomo','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1926,22,13,1204,'2022-03-12',0,'alas,','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(1927,45,15,37,'2021-11-25',1,'trago.Y','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1928,26,7,1858,'2020-03-22',2,'amenaza','y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(1929,21,22,NULL,'2021-02-02',0,'es','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1930,13,22,NULL,'2021-12-17',1,'yo','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1931,31,1,286,'2022-06-10',1,'tiempoque','Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(1932,13,5,NULL,'2023-02-04',1,'gente,','Antonio Pío en clemencia,Marco Aurelio en igualdaddel semblante,Adriano en la elocuencia,Teodosio en humanidady buen talante,Aurelio Alejandro fueen disciplina y rigorde la guerra,un Constantino en la fe,Camilo en el gran amorde su tierra.'),(1933,6,25,396,'2022-05-28',4,'en','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1934,29,26,442,'2020-02-08',0,'4','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1935,13,26,869,'2022-11-25',1,'oradores;no','Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1936,2,1,NULL,'2021-04-07',2,'dulces','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1937,5,11,1729,'2020-01-29',4,'van','Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1938,10,24,358,'2023-04-15',3,'bajos','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1939,19,22,NULL,'2021-01-24',3,'ver','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(1940,5,17,NULL,'2022-03-22',2,'Prelados,así','si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1941,49,12,461,'2023-10-19',3,'fe,Camilo','¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1942,29,15,1428,'2023-07-01',1,'dulces,','Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1943,29,8,83,'2021-08-23',0,'primero','Qué vanidad imaginarque 