uereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(1953,5,19,329,'2022-07-22',1,'del','Hay besos que producen desvaríosde amorosa pasión ardiente y loca,tú los conoces bien son besos míosinventados por mí, para tu boca.'),(1954,42,1,162,'2022-05-25',1,'las','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1955,37,11,1863,'2021-06-29',2,'y','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1956,47,8,289,'2021-03-29',2,'desventajas,y','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1957,24,4,217,'2023-07-20',1,'amor','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1958,22,17,NULL,'2023-05-16',3,'donde','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1959,5,23,NULL,'2021-12-07',2,'esta','por un beso… yo no séqué te diera por un beso.'),(1960,34,7,1645,'2022-04-25',2,'esa','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(1961,20,2,486,'2021-06-16',0,'dudas.Si','y perder, y empezar de nuevo desde el principioy nunca decir ni una palabra sobre tu pérdida.Si puedes forzar tu corazón, y tus nervios y tendones,a cumplir con tus objetivos mucho después de que estén agotados,y así resistir cuando ya no te queda nadasalvo la Voluntad, que les dice: “¡Resiste!”.Si puedes hablar a las masas y conservar tu virtud.O caminar junto a reyes, sin menospreciar por ello a la gente común.Si ni amigos ni enemigos pueden herirte.Si todos pueden contar contigo, pero ninguno demasiado.'),(1962,7,20,1694,'2021-05-14',2,'de','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1963,18,26,541,'2022-11-20',0,'murió.;Ved','Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(1964,8,18,NULL,'2023-11-18',1,'se','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1965,18,13,669,'2021-06-11',2,'más','Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1966,50,20,546,'2020-07-14',3,'nos','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1967,45,26,330,'2022-09-06',1,'heridaEl','Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1968,46,17,NULL,'2022-03-08',0,'un','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1969,20,14,1737,'2023-04-05',3,'fantasma,te','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1970,4,7,1733,'2023-08-21',1,'cuando','no sabrán nunca que nos hemos ido.'),(1971,41,10,1213,'2021-02-06',1,'mantienen.;Los','diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1972,2,1,1265,'2022-08-21',2,'estómago.Mi','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1973,14,15,1237,'2023-11-24',0,'mundo.;Tirar','En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(1974,50,3,NULL,'2021-09-15',1,'y',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1975,27,5,NULL,'2022-05-04',4,'dicha.Olvidemosel','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1976,36,24,175,'2023-10-10',2,'hablado,de','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(1977,19,19,1018,'2023-06-03',3,'desmedidas,los','¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1978,43,7,1863,'2021-07-24',0,'por','cómo después de acordadoda dolor'),(1979,5,2,NULL,'2021-08-22',0,'cansado','Podrá nublarse el sol eternamente'),(1980,15,22,NULL,'2021-12-19',0,'mi','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, 