migo,¡cuán poco duró con éllo que le dio!'),(1990,36,25,1146,'2022-09-17',2,'volar.Si','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1991,8,5,1916,'2020-06-29',4,'lento...Hoy','Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(1992,5,21,1927,'2021-11-25',0,'caballeros','La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(1993,45,24,1372,'2022-04-15',0,'trago;y','Estas sus viejas historiasque con su brazo pintóen juventud,con otras nuevas victoriasahora las renovóen senectud.Por su gran habilidad,por méritos y ancianíabien gastada,alcanzó la dignidadde la gran caballeríade la Espada.'),(1994,6,3,1403,'2022-03-22',1,'aun','Se extingue el díapero no el canto de la alondra'),(1995,45,24,NULL,'2022-05-08',3,'montaña','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1996,16,1,NULL,'2023-01-08',1,'volar.Si','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1997,34,11,1367,'2023-09-20',1,'olvidada,el','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1998,8,19,92,'2022-05-17',0,'mañana:Yo','Las huestes innume